import React, { Component } from "react";
import "./style/style.css";
import axios from "axios";

class App extends Component {
  constructor() {
    super();
    this.state = {
      persons: []
    };
  }

  componentDidMount() {
    axios.get(`https://jsonplaceholder.typicode.com/comments`).then(res => {
      const persons = res.data;
      this.setState({ persons });
    });
  }
  renderTable() {
    return this.state.persons.map(person => {
      return (
        <tbody key={person.id}>
          <tr>
            <td>{person.postId}</td>
            <td>{person.id}</td>
            <td>{person.name} </td>
          </tr>
        </tbody>
      );
    });
  }
  render() {
    console.log(this.state.persons.name);
    return (
      <div>
        <table className="listTable">
          {this.renderTable()}
          <thead>
            <tr>
              <th>PostId</th>
              <th>ID</th>
              <th>Komentarai</th>
            </tr>
          </thead>
        </table>
      </div>
    );
  }
}

export default App;
